import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls, InnerBlocks } = wp.blockEditor;
const { useState } = wp.element;
const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
  CheckboxControl
} = wp.components;

const year = new Date().getFullYear();
const name = 'gb/gb4columnwithnewsletterandlocalization';

registerBlockType(name, {
  title: __("4 Column With Newsletter and Localization", "GB"),
  icon: <img src="data:image/png;base64," />,
  category: "footer",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    message: {
      type: "string",
      default: "",
    },
    subject: {
      type: "string",
      default: "",
    },
    to: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    menusMarkup:{
      type: "string",
      default: "",
    },
    contentVN: { type: "string", default: `Footer` },
    contentUU: { type: "string", default: `Language &amp; Currency` },
    contentUV: { type: "string", default: `Language` },
    contentUW: { type: "string", default: `English` },
    contentUX: { type: "string", default: `French` },
    contentUY: { type: "string", default: `German` },
    contentUZ: { type: "string", default: `Japanese` },
    contentVA: { type: "string", default: `Spanish` },
    contentVB: { type: "string", default: `Currency` },
    contentVC: { type: "string", default: `ARS` },
    contentVD: { type: "string", default: `AUD` },
    contentVE: { type: "string", default: `CAD` },
    contentVF: { type: "string", default: `CHF` },
    contentVG: { type: "string", default: `EUR` },
    contentVH: { type: "string", default: `GBP` },
    contentVI: { type: "string", default: `JPY` },
    contentVJ: { type: "string", default: `USD` },
    contentVK: { type: "string", default: `Subscribe to our newsletter` },
    contentVL: {
      type: "string",
      default: `The latest news, articles, and resources, sent to your inbox weekly.`,
    },
    contentVM: { type: "string", default: `Email address` },
    contentt: { type: "string", default: `Subscribe` },
    contentVT: {
      type: "string",
      default: `&copy; ${year} Workflow, Inc. All rights reserved.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;
    const [ menus, setMenus ] = useState( [] );
    const [ availableMenus, setAvailabelMenus ] = useState( [] );
    const { subscribe } = wp.data;
    const arData = repeaterData(props.attributes.hidden, true);


    const closeListener = subscribe( () => {
      const isReady =  !!wp.data.select('core').getMenus() && !!wp.data.select('core').getMenuItems();
      if ( ! isReady ) {
        return;
      }

      setAvailabelMenus(wp.data.select('core').getMenus().map((b) => {
        let menuHTML = '';

        menuHTML += `<h3 class="text-sm font-semibold text-gray-400 tracking-wider uppercase">${b.name}</h3><ul role="list" class="mt-4 space-y-4">`;
        wp.data.select('core').getMenuItems().map((item) => {  
          
          if (b.id === item.menus) {
            menuHTML += `<li><a href="${item.url}" class="text-base text-gray-500 hover:text-gray-900">${item.title.raw}</a></li>`
          }

        });
       
        menuHTML += '</ul>';

        closeListener();
        return { id: b.id, name: b.name, markup: menuHTML }

      }));
    });

    
    const handleChangeGroup = (selectedItem) => {
      let temp  = [];
      if (menus.includes(selectedItem)) {
          const tempArray = menus.filter(item => item !== selectedItem);
          temp = [...tempArray];
      } else {
          temp = [...menus, selectedItem];
      }

      showMenus(selectedItem, temp);

      setMenus(temp);

      return temp;
    };

    const showMenus = (selectedItem, temp) => {
      let cont = 0;
      let markup = '';

      temp.map((a)=> {

        if (cont % 2 === 0) {
          markup += '<div class="md:grid md:grid-cols-2 md:gap-8"><div>';
        } else {
          markup += '<div class="mt-12 md:mt-0">';
        }

        markup += availableMenus.filter(obj => obj.id === a)[0].markup;

        if ((cont % 2 !== 0)) {
          markup += '</div></div>';
        } else {
          markup += '</div>';
        }

        if (cont === menus.length){
          markup += '</div>';
        }

        cont++;

        return markup;
    })
      setAttributes({menusMarkup: markup});

      return markup;
    }

    return (
      <footer className="bg-white" aria-labelledby="footer-heading">
        <InspectorControls>
          <PanelBody title="Menus">
              { availableMenus.map(function(k) {        

                  return <PanelRow>
                            <CheckboxControl

                              label={ k.name }
                              value={k.id}
                              checked={menus.includes(k.id)}
                              onChange={ () => handleChangeGroup(k.id)}
                            />
                          
                          </PanelRow>
                         
                })}           
            
          </PanelBody>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={attributes.to}
                    onChange={(to) => setAttributes({to})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={attributes.subject}
                    onChange={(subject) => setAttributes({subject})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={attributes.message}
                    onChange={(message) => setAttributes({message})}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <h2 id="footer-heading" className="sr-only">
          <RichText
            value={attributes.contentVN}
            default={"Footer"}
            onChange={(newtext) => setAttributes({ contentVN: newtext })}
          />
        </h2>
        <div className="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8">
          <div className="pb-8 xl:grid xl:grid-cols-5 xl:gap-8 menus-wrapper">
              {wp.element.RawHTML( { children: attributes.menusMarkup})}
            <div className="mt-12 xl:mt-0">
              <h3 className="text-sm font-semibold text-gray-400 tracking-wider uppercase">
                <RichText
                  value={attributes.contentUU}
                  default={"Language &amp; Currency"}
                  onChange={(newtext) =>
                    setAttributes({ contentUU: newtext })
                  }
                />
              </h3>
              <form className="mt-4 sm:max-w-xs">
                <fieldset className="w-full">
                  <label for="language" className="sr-only">
                    <RichText
                      value={attributes.contentUV}
                      default={"Language"}
                      onChange={(newtext) =>
                        setAttributes({ contentUV: newtext })
                      }
                    />
                  </label>
                  <div className="relative">
                    <select
                      id="language"
                      name="language"
                      className="appearance-none block w-full bg-none bg-white border border-gray-300 rounded-md py-2 pl-3 pr-10 text-base text-gray-900 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
                    >
                      <option selected>
                        <RichText
                          value={attributes.contentUW}
                          default={"English"}
                          onChange={(newtext) =>
                            setAttributes({ contentUW: newtext })
                          }
                        />
                      </option>
                      <option>
                        <RichText
                          value={attributes.contentUX}
                          default={"French"}
                          onChange={(newtext) =>
                            setAttributes({ contentUX: newtext })
                          }
                        />
                      </option>
                      <option>
                        <RichText
                          value={attributes.contentUY}
                          default={"German"}
                          onChange={(newtext) =>
                            setAttributes({ contentUY: newtext })
                          }
                        />
                      </option>
                      <option>
                        <RichText
                          value={attributes.contentUZ}
                          default={"Japanese"}
                          onChange={(newtext) =>
                            setAttributes({ contentUZ: newtext })
                          }
                        />
                      </option>
                      <option>
                        <RichText
                          value={attributes.contentVA}
                          default={"Spanish"}
                          onChange={(newtext) =>
                            setAttributes({ contentVA: newtext })
                          }
                        />
                      </option>
                    </select>
                    <div className="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      <svg
                        className="h-4 w-4 text-gray-400"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
                <fieldset className="mt-4 w-full">
                  <label for="currency" className="sr-only">
                    <RichText
                      value={attributes.contentVB}
                      default={"Currency"}
                      onChange={(newtext) =>
                        setAttributes({ contentVB: newtext })
                      }
                    />
                  </label>
                  <div className="relative">
                    <select
                      id="currency"
                      name="currency"
                      className="appearance-none block w-full bg-none bg-white border border-gray-300 rounded-md py-2 pl-3 pr-10 text-base text-gray-900 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
                    >

                    {arData.map((v)=>{
                      return (
                        <option value={v.currency}>{v.currency}</option>
                      )
                    })}
                    </select>
                    <div className="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      <svg
                        className="h-4 w-4 text-gray-400"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
              </form>
            </div>
          </div>
          <div className="border-t border-gray-200 pt-8 lg:flex lg:items-center lg:justify-between xl:mt-0">
            <div>
              <h3 className="text-sm font-semibold text-gray-400 tracking-wider uppercase">
                <RichText
                  value={attributes.contentVK}
                  default={"Subscribe to our newsletter"}
                  onChange={(newtext) =>
                    setAttributes({ contentVK: newtext })
                  }
                />
              </h3>
              <p className="mt-2 text-base text-gray-500">
                <RichText
                  value={attributes.contentVL}
                  default={
                    "The latest news, articles, and resources, sent to your inbox weekly."
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentVL: newtext })
                  }
                />
              </p>
            </div>
            <form className="mt-4 sm:flex sm:max-w-md">
              <label for="email-address" className="sr-only">
                <RichText
                  value={attributes.contentVM}
                  default={"Email address"}
                  onChange={(newtext) =>
                    setAttributes({ contentVM: newtext })
                  }
                />
              </label>
              <input
                type="email"
                name="email-address"
                id="email-address"
                autocomplete="email"
                required
                className="appearance-none min-w-0 w-full bg-white border border-gray-300 py-2 px-4 text-base rounded-md text-gray-900 placeholder-gray-500 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:placeholder-gray-400 sm:max-w-xs"
                placeholder="Enter your email"
              />
              <div className="mt-3 rounded-md sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                <button
                  type="submit"
                  className="w-full bg-indigo-600 border border-transparent rounded-md py-2 px-4 flex items-center justify-center text-base font-medium text-white hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                >
                  <RichText
                    value={attributes.contentt}
                    default={"Subscribe"}
                    onChange={(newtext) =>
                      setAttributes({ contentt: newtext })
                    }
                  />
                </button>
              </div>
            </form>
          </div>
          <div className="mt-8 border-t border-gray-200 pt-8 md:flex md:items-center md:justify-between">
            <div className="flex space-x-6 md:order-2">
              <InnerBlocks
                allowedBlocks={["core/social-links"]}
                template={[["core/social-links"]]} templateLock="all"
              />
            </div>
            <p className="mt-8 text-base text-gray-400 md:mt-0 md:order-1">
              <RichText
                value={attributes.contentVT}
                default={"&copy; 2020 Workflow, Inc. All rights reserved."}
                onChange={(newtext) => setAttributes({ contentVT: newtext })}
              />
            </p>
          </div>
        </div>
      </footer>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
     
      <footer class="bg-white" aria-labelledby="footer-heading">
        <h2 id="footer-heading" class="sr-only">
         <RichText.Content value={attributes.contentVN}/>
        </h2>
        <div class="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8">
            <div className="pb-8 xl:grid xl:grid-cols-5 xl:gap-8 menus-wrapper">
              {wp.element.RawHTML( { children: attributes.menusMarkup } )}
            <div class="mt-12 xl:mt-0">
              <h3 class="text-sm font-semibold text-gray-400 tracking-wider uppercase">
               <RichText.Content value={attributes.contentUU}/>
              </h3>
              <form class="mt-4 sm:max-w-xs">
                <fieldset class="w-full">
                  <label for="language" class="sr-only">
                   <RichText.Content value={attributes.contentUV}/>
                  </label>
                  <div class="relative">
                    <select
                      id="language"
                      name="language"
                      class="appearance-none block w-full bg-none bg-white border border-gray-300 rounded-md py-2 pl-3 pr-10 text-base text-gray-900 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
                    >
                      <option selected>{attributes.contentUW} </option>
                      <option>{attributes.contentUX} </option>
                      <option>{attributes.contentUY} </option>
                      <option>{attributes.contentUZ} </option>
                      <option>{attributes.contentVA} </option>
                    </select>
                    <div class="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      <svg
                        class="h-4 w-4 text-gray-400"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
                <fieldset class="mt-4 w-full">
                  <label for="currency" class="sr-only">
                   <RichText.Content value={attributes.contentVB}/>
                  </label>
                  <div class="relative">
                    <select
                      id="currency"
                      name="currency"
                      class="appearance-none block w-full bg-none bg-white border border-gray-300 rounded-md py-2 pl-3 pr-10 text-base text-gray-900 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
                    >
                      <option>{attributes.contentVC} </option>
                      <option selected>{attributes.contentVD} </option>
                      <option>{attributes.contentVE} </option>
                      <option>{attributes.contentVF} </option>
                      <option>{attributes.contentVG} </option>
                      <option>{attributes.contentVH} </option>
                      <option>{attributes.contentVI} </option>
                      <option>{attributes.contentVJ} </option>
                    </select>
                    <div class="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      <svg
                        class="h-4 w-4 text-gray-400"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
              </form>
            </div>
          </div>
          <div class="border-t border-gray-200 pt-8 lg:flex lg:items-center lg:justify-between xl:mt-0">
            <div>
              <h3 class="text-sm font-semibold text-gray-400 tracking-wider uppercase">
               <RichText.Content value={attributes.contentVK}/>
              </h3>
              <p class="mt-2 text-base text-gray-500">
               <RichText.Content value={attributes.contentVL}/>
              </p>
            </div>
            <form
              class="mt-4 sm:flex sm:max-w-md lg:mt-0"
              action={attributes.action}
              method={attributes.method}
            >
              {arData.map((v) => {
                return <input type="hidden" name={v.name} value={v.val} />;
              })}
              <label for="email-address" class="sr-only">
               <RichText.Content value={attributes.contentVM}/>
              </label>
              <input
                type="email"
                name="email-address"
                id="email-address"
                autocomplete="email"
                required
                class="appearance-none min-w-0 w-full bg-white border border-gray-300 py-2 px-4 text-base rounded-md text-gray-900 placeholder-gray-500 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:placeholder-gray-400 sm:max-w-xs"
                placeholder="Enter your email"
              />
              <div class="mt-3 rounded-md sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                <button
                  type="submit"
                  class="w-full bg-indigo-600 border border-transparent rounded-md py-2 px-4 flex items-center justify-center text-base font-medium text-white hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                  onclick={`sendEmail('${name}'); return false;`}
                >
                 <RichText.Content value={attributes.contentt}/>
                </button>
              </div>
            </form>
          </div>
          <div class="mt-8 border-t border-gray-200 pt-8 md:flex md:items-center md:justify-between">
            <div class="flex space-x-6 md:order-2">
              <InnerBlocks.Content/>
            </div>
            <p class="mt-8 text-base text-gray-400 md:mt-0 md:order-1">
             <RichText.Content value={attributes.contentVT}/>
            </p>
          </div>
        </div>
      </footer>
    );
  },
});
